    }
    this.add.text(0, gameOptions.yblocks*gameOptions.blocksize, "Pick all flowers with arrow keys. Wasps will sting", {fontSize: "28px", fill: "#000000", fontStyle: "bold"});
    this.add.text(0, gameOptions.yblocks*gameOptions.blocksize + 28, "you and butterflies will suck the flowers...", {fontSize: "28px", fill: "#000000", fontStyle: "bold"});
    this.add.text(0, gameOptions.yblocks*gameOptions.blocksize + 28*2, "The walls are moving. You can shoot the insects", {fontSize: "28px", fill: "#000000", fontStyle: "bold"});
    this.add.text(0, gameOptions.yblocks*gameOptions.blocksize + 28*3, "with the mouse and gain more points. ", {fontSize: "28px", fill: "#000000", fontStyle: "bold"});

    this.cursors = this.input.keyboard.createCursorKeys();
  }

  isCloseEnough(body1, body2) {
    if (Math.abs(body1.body.center.x - body2.body.center.x) < gameOptions.overlapDistance && Math.abs(body1.body.center.y - body2.body.center.y) < gameOptions.overlapDistance) {
      return true;
    }
    return false;
  }

  collectFlower(man, flower) {
    flower.disableBody(true, true);
    this.collectSound.play();
    if (flower.body.gameObject.texture.key == "flowerBlue") score += gameOptions.blueFlowerScore;
    else score += gameOptions.redFlowerScore;
    this.scoreText.setText(score);
    numflowers --;
    if(numflowers == 0) { 
      this.time.removeAllEvents();
      this.butterflyGroup.getChildren().forEach(element => {
        element.disableBody(true, true);
      });
      this.waspGroup.getChildren().forEach(element => {
        element.disableBody(true, true);
      });
      score += gameOptions.levelScore;
      this.scoreText.setText(score);
      if (level == gameOptions.maxlevel) { 
        this.gameText.setText(`Level ${level}/${gameOptions.maxlevel} completed, game finished`);
        this.time.addEvent({
          delay: 4000,
          callback: ()=>{
            numflowers = 0;
            numBlocks = 0;
            this.flowers = [];
            this.blocks = 0;
            this.scene.start("ScoreBoard");
          },
          loop: false
        });
      }
      else {
        this.gameText.setText(`Level ${level}/${gameOptions.maxlevel} completed`);
        this.time.addEvent({
          delay: 2000,
          callback: ()=>{
            numflowers = 0;
            numBlocks = 0;
            this.flowers = [];
            this.blocks = [];
            level ++;
            this.scene.start("PlayGame");
          },
          loop: false
        })
      }
    }
  }



